#include <iostream>#include <stdio.h>bool IsMatched(long long n){    long long square = n*n;    for (int i = 9; i >= 0; i--)    {        if (square % 10 != i)        {            return false;        }        square /= 100;    }    return true;}long long Solve(){    for (long long i = 101010103; i < 138902663; i += 10)    {        if (IsMatched(i))        {            return i*10;        }    }    for (long long i = 101010107; i < 138902663; i += 10)    {        if (IsMatched(i))        {            return i*10;        }    }    return -1;}int main(int argc, char* argv[]){    std::cout << Solve() << std::endl;    return 0;}